        leagueAnimal: "\n\u3010\u516C\u4F1ABOSS\u8BF4\u660E\u3011\n1.\u4F1A\u957F\u548C\u526F\u4F1A\u957F\u6709\u6743\u9650\u82B1\u8D39\u4E00\u5B9A\u516C\u4F1A\u6D3B\u8DC3\u5F00\u542F\u516C\u4F1ABOSS\uFF0C\u516C\u4F1ABOSS\u6BCF\u5929\u53EF\u4EE5\u5F00\u542F\u4E00\u6B21\u3002\n2.\u516C\u4F1ABOSS\u5F00\u542F\u540E\uFF0C\u6BCF\u540D\u516C\u4F1A\u6210\u5458\u90FD\u6709\u4E00\u5B9A\u7684\u6311\u6218\u673A\u4F1A\u3002\n3.\u6BCF\u6B21\u6311\u6218\u5F00\u59CB\u524D\uFF0C\u73A9\u5BB6\u90FD\u53EF\u4EE5\u4F7F\u75285\u6B21\u6FC0\u52B1\uFF0C\u6FC0\u52B1\u4EC5\u5BF9\u5F53\u6B21\u6311\u6218\u6709\u6548\u3002\n4.\u6210\u5458\u5728\u89C4\u5B9A\u65F6\u95F4\u5185\u51FB\u6740BOSS\uFF0C\u5219\u53EF\u5F00\u542F\u5E86\u529F\u5BB4\u3002\n5.\u5E86\u529F\u5BB4\u4F1A\u6301\u7EED\u4E00\u6BB5\u65F6\u95F4\uFF0C\u671F\u95F4\u6BCF\u540D\u6210\u5458\u53EF\u4EE5\u9886\u53D6\u4E00\u4EFD\u5E86\u529F\u5BB4\u5956\u52B1\u3002\n6.\u516C\u4F1A\u6210\u5458\u53EF\u5728\u5E86\u529F\u5BB4\u4E2D\u82B1\u8D39\u94BB\u77F3\u8FDB\u884C\u201C\u52A0\u83DC\u201D\uFF0C\u52A0\u83DC\u540E\u6240\u6709\u6210\u5458\u53EF\u989D\u5916\u9886\u53D6\u4E00\u4EFD\u5956\u52B1\u3002\n",
